.findOneAndUpdate() removes all elements in array<p>I'm making discord which has warning system and that works great, but I want to create <code>editwarn</code> command so if someone mistype they can edit the warn reason. The problem with my code is that it replaces all elements in Array with the new reason. </p>

<p>You can see on the pictures that if I do the command <code>!editwarn 2 (because i want to edit second warn) not working</code> it replaces all of the elements in array with <code>not working</code>.</p>

<p><a href="https://i.stack.imgur.com/2Nfje.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/2Nfje.png" alt="enter image description here"></a>
<a href="https://i.stack.imgur.com/6DWQg.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/6DWQg.png" alt="enter image description here"></a></p>

<p>my code</p>

<pre class="lang-js prettyprint-override"><code>//declare user and userid
let user = message.mentions.users.first()

let split = args.slice(2).join(" ")

Warning.findOneAndUpdate({ userID: user.id },
     { $set: { reason: split } },
     { new: true }).exec((err, data) =&gt; {
          if (err) throw err;
          if (!data) {
             return message.reply("User doesn't have any warnings.")
          } else {
              if (args[1] &gt; data.warns) return message.reply("User doesn't have that warning.")
              modLogs.send(embed)
              message.delete();
              return message.reply(`${user.tag} info succesfully edited!`)
         }
});
</code></pre>

<p>I don't think this has anything to do with it but I will write it here</p>

<p>My scheme</p>

<pre class="lang-js prettyprint-override"><code>const mongoose = require("mongoose");

const newScheme = mongoose.Schema({
    name: String,
    warns: Number,
    reason: Array,
    userID: String
}, {
    versionKey: false
})

module.exports = mongoose.model('Warning', newScheme)
</code></pre>

