Sort array of objects, using values inside each object (aggregation framework)<p>Suppose I have these documents:</p>
<pre><code>[
  {
    '_id': 1,
    'roles': [
      {
        'k': 'free',
        'v': 1
      },
      {
        'k': 'pro',
        'v': 5
      },
      {
        'k': 'free',
        'v': 2
      }
    ]
  },
  {
    '_id': 2,
    'roles': [
      {
        'k': 'pro',
        'v': 1
      },
      {
        'k': 'free',
        'v': 3
      },
      {
        'k': 'free',
        'v': 2
      }
    ]
  }
]
</code></pre>
<p>So for every <code>_id</code>, we have a array of documents called <code>roles</code>.<br />
I need to sort inside the array <code>roles</code>, using the <code>v</code> field.</p>
<p><strong>Expected output:</strong></p>
<pre><code>[
  {
    '_id': 1,
    'roles': [
      {
        'k': 'free',
        'v': 1
      },
      {
        'k': 'free',
        'v': 2
      }
      {
        'k': 'pro',
        'v': 5
      }
    ]
  },
  {
    '_id': 2,
    'roles': [
      {
        'k': 'pro',
        'v': 1
      },
      {
        'k': 'free',
        'v': 2
      }
      {
        'k': 'free',
        'v': 3
      }
    ]
  }
]
</code></pre>
<p>So I tried to use <code>$sort</code>:</p>
<pre><code>{
  '$sort': {
     'roles.v': 1
  }
}
</code></pre>
<p>But it does not sort inside the array.</p>

