How to properly update nested array while multithreading in mongodb?<p>I'm learning how to program, and in my journey, I decided to learn how to use databases and the chosen one was mongodb. 
In my db, I have a object called WarClan, and inside WarClan, I have an List of ClanUser, and each ClanUser have a List of GameItem, which is supposed to be the player inventory. Like represented bellow:</p>

<pre><code>public class WarClan
{
    [BsonId]
    public ObjectId Id { get; set; }
    public string ClanName { get; set; }
    public List&lt;ClanUser&gt; ClanUsers { get; set; }
}
public class ClanUser
{
    public int Cid { get; set; }
    public List&lt;GameItem&gt; Inventario {get;set;}
}
</code></pre>

<p>I have a "GameServer" which has multiples channel instances running in different threads. And the player can be connected in multiples channels at once. The Game has some functions for example, item giveaway, item drops, inventory commands and etc. 
Yesterday I realized that a player sold an item on the market, but the item wasn't taken away. And now I believe its the way I wrote the code. Here is my code to "update inventory"(which update the whole player data, lol):</p>

<pre><code>public async Task UpdateUser(WarClan clan, ClanUser user) 
    {
        var collection = db.GetCollection&lt;WarClan&gt;("clans");
        var arrayFilter = Builders&lt;WarClan&gt;.Filter.Eq("ClanName", clan.ClanName)
                &amp; Builders&lt;WarClan&gt;.Filter.Eq("ClanUsers.Cid", user.Cid);
        var arrayUpdate = Builders&lt;WarClan&gt;.Update.Set("ClanUsers.$", user);
        await collection.UpdateOneAsync(arrayFilter, arrayUpdate);
    }
</code></pre>

<p>I believe that at same time the item was sold, he did something that needs to call update user too, and I think something like this happened(I'm not sure, just trying to understand):</p>

<pre><code>    //Thread1:
    var user = await GetUser(123456); //By CID
    user.Inventario.Add(Item3);
    await UpdateUser(clan, user);

    //Thread2:
    var user = await GetUser(123456); //By CID
    user.Inventario.Add(Item4);
    await UpdateUser(clan, user);

/*
* The expected result: 
* User.Inventario = Item3, Item4
* 
* Given result:
* User.Inventario = Item4 
* OR
* User.Inventario = Item3
*/
</code></pre>

<p>How can I avoid problems like this? I'm a little bit lost at this point, I don't know what to search D: </p>

