  "username": "johan@gmail.com",
  "password": "123",
  "decks": [{
      "cards": [{
          "_id": "5ebd08794bcc8d2fd893f4a9",
          "planeetnaam": "Venus",
          "kleur": "Grijs"
        },
        {
          "_id": "5ebd08794bcc8d2fd893f4aa",
          "planeetnaam": "Neptunus",
          "kleur": "Paars"
        }
      ],
      "_id": "5ebd08794bcc8d2fd893f4a8",
      "name": "Planeten"
    },
    {
      "cards": [{
          "_id": "5ebd08794bcc8d2fd893f4ac",
          "diernaam": "Hond",
          "poten": "4"
        },
        {
          "_id": "5ebd08794bcc8d2fd893f4ad",
          "diernaam": "Kangoeroe",
          "poten": "2"
        }
      ],
      "_id": "5ebd08794bcc8d2fd893f4ab",
      "name": "Dieren"
    }
  ],
  "__v": 0
}
</code></pre>

<p>Now i want to add a new property to all the cards in deck with deckname: "Planeten". How do i do this with a mongoose query?
The cards array of deck "Planeten" should look like this after the query</p>

<pre><code>"cards": [{
    "_id": "5ebd08794bcc8d2fd893f4a9",
    "planeetnaam": "Venus",
    "kleur": "Grijs",
    "newProp": null
  },
  {
    "_id": "5ebd08794bcc8d2fd893f4aa",
    "planeetnaam": "Neptunus",
    "kleur": "Paars",
    "newProp": null
  }
],
</code></pre>

<p>EDIT:
This works in Robo3T:</p>

<pre><code>db.getCollection('users').findOneAndUpdate(
    { '_id': ObjectId("5eba9ee0abfaf237f81fb104") },
    { $set: { 'decks.$[deck].cards.$[].newProp': null }  },
    { arrayFilters: [{ 'deck._id': ObjectId("5eba9ee0abfaf237f81fb108")  }  ]  }
 )
</code></pre>

<p>But the server query doesnt edit any data:</p>

