        { '_id': req.session.userid },
        { $set: { 'decks.$[deck].cards.$[].newProp': null }  },
        { arrayFilters: [{ 'deck._id': req.params.deckid  }  ] }, function(err, user){
            res.send('test');
        })
</code></pre>

<p>Thanks in advance</p>

